INSERT INTO `sys_data_backup` VALUES (17, 'gateway_endpoint_plugin', 'UPDATE', '{\"id\": 859, \"pluginId\": \"endpointPlugin_563058031051407360\", \"gmtCreate\": 1554313896000, \"endpointId\": \"endpoint_563058029533069313\", \"pluginName\": \"groovy脚本执行插件\", \"pluginType\": \"GroovyExecuteRequestPlugin\", \"gmtModified\": 1554313896000, \"pluginParam\": \"{\\\"groovyScript\\\": \\\"package io.github.tesla.filter.endpoint.plugin.request.user;\\\\n\\\\nimport io.github.tesla.auth.sdk.signer.Header;\\\\nimport io.github.tesla.filter.endpoint.plugin.request.GroovyExecuteRequestPlugin;\\\\nimport io.github.tesla.filter.support.servlet.NettyHttpServletRequest;\\\\nimport io.github.tesla.filter.utils.JsonUtils;\\\\nimport io.netty.handler.codec.http.FullHttpRequest;\\\\nimport io.netty.handler.codec.http.HttpObject;\\\\nimport io.netty.handler.codec.http.HttpResponse;\\\\nimport java.util.ArrayList;\\\\nimport java.util.List;\\\\nimport java.util.Map;\\\\n\\\\npublic class UserGroovyRequestPlugin extends GroovyExecuteRequestPlugin {\\\\n\\\\n    @Override\\\\n    public HttpResponse doFilter(NettyHttpServletRequest servletRequest, HttpObject realHttpObject) {\\\\n        try {\\\\n            FullHttpRequest realRequest = (FullHttpRequest) realHttpObject;\\\\n            if (realRequest.headers().get(\\\\\\\"X-Real-Ip\\\\\\\") != null) {\\\\n                realRequest.headers().set(\\\\\\\"X-User-Ip\\\\\\\", realRequest.headers().get(\\\\\\\"X-Real-Ip\\\\\\\"));\\\\n            }\\\\n            List<Header> headers = buildHeaders(realRequest);\\\\n            LOGGER.info(\\\\\\\"request url: {} , headers: {}\\\\\\\", servletRequest.getRequestURI(), JsonUtils\\\\n                    .serializeToJson(headers));\\\\n        } catch (Exception e) {\\\\n            LOGGER.error(e.getMessage(), e);\\\\n        }\\\\n        return null;\\\\n    }\\\\n\\\\n    private List<Header> buildHeaders(FullHttpRequest servletRequest) {\\\\n        List<Header> headers = new ArrayList<>();\\\\n        for (Map.Entry<String, String> header : servletRequest.headers()) {\\\\n            headers.add(new Header(header.getKey(), header.getValue()));\\\\n        }\\\\n        return headers;\\\\n    }\\\\n}\\\"}\"}', '2019-04-10 10:37:24', 'admin');
